UPDATE etfs_ativos_reais 
    SET dividends_12m = CASE symbol
        WHEN 'RSEE' THEN 2.7969999999999997 WHEN 'TLT' THEN 1.264 WHEN 'LMBS' THEN 0.68 WHEN 'EIS' THEN 1.8170000000000002 WHEN 'ALAI' THEN 0.173 WHEN 'CCSO' THEN 0.306 WHEN 'SCHD' THEN 1.0256669999999999 WHEN 'DECW' THEN 0.357 WHEN 'BSMR' THEN 0.225 WHEN 'STRV' THEN 0.414 WHEN 'BIS' THEN 0.599 WHEN 'SCHR' THEN 0.315 WHEN 'SIMS' THEN 0.257 WHEN 'VO' THEN 4.136 WHEN 'MSMR' THEN 0.782 WHEN 'IYG' THEN 0.9259999999999999 WHEN 'DFE' THEN 2.593 WHEN 'XLF' THEN 0.722 WHEN 'DYLG' THEN 0.381 WHEN 'IGSB' THEN 0.7689999999999999
    END,
    updatedat = NOW()
    WHERE symbol IN ('RSEE', 'TLT', 'LMBS', 'EIS', 'ALAI', 'CCSO', 'SCHD', 'DECW', 'BSMR', 'STRV', 'BIS', 'SCHR', 'SIMS', 'VO', 'MSMR', 'IYG', 'DFE', 'XLF', 'DYLG', 'IGSB');